package m11.mib.paf.quiz.category;

/**
 * CategoryInitilializer
 * Startup databse filler for categories
 *
 * @author M11
 * @version 1.0
 */
public class CategoryInitializer {

    // ~~~ Names for the standard categories
    public static final String GEOGRAPHY = "Geografie";
    public static final String ENTERTAINMENT = "Unterhaltung";
    public static final String HISTORY = "Geschichte";
    public static final String ART_AND_LITERATURE = "Kunst und Literatur";
    public static final String SCIENCE_AND_NATURE = "Wissenschaft und Technik";
    public static final String SPORT_AND_LEISURE = "Sport und Vergn√ºgen";
    
    private final CategoryRepository categoryRepository; // ~~~ CrudRepository of the categories, injected by Spring
    
    public CategoryInitializer(
	    CategoryRepository categoryRepository
	   ) {
	this.categoryRepository = categoryRepository;
    }

    /**
     * @param categoryName for which the standard image is wanted
     * @return the standard image of the given category name
     */
    public static String getImageFor(String categoryName) {
	switch (categoryName) {
	case CategoryInitializer.GEOGRAPHY:
	    return CategoryInitializer.getGeographyImage();
	case CategoryInitializer.ENTERTAINMENT:
	    return CategoryInitializer.getEntertainmentImage();
	case CategoryInitializer.HISTORY:
	    return CategoryInitializer.getHistoryImage();
	case CategoryInitializer.ART_AND_LITERATURE:
	    return CategoryInitializer.getArtsAndLiteratureImage();
	case CategoryInitializer.SCIENCE_AND_NATURE:
	    return CategoryInitializer.getScienceAndNatureImage();
	case CategoryInitializer.SPORT_AND_LEISURE:
	    return CategoryInitializer.getSportAndLeisureImage();
	}
	return "";
    }
    
    /**
     * @return the image for geography questions as base64 string
     */
    public static String getGeographyImage() {
	return "data:image/jpeg;base64,";
    }
    
    /**
     * @return the image for entertainment questions as base64 string
     */
    public static String getEntertainmentImage() {
	return "";
    }
    
    /**
     * @return the image for history questions as base64 string
     */
    public static String getHistoryImage() {
	return "";
    }
    
    /**
     * @return the image for arts and literature questions as base64 string
     */
    public static String getArtsAndLiteratureImage() {
	return "";
    }
    
    /**
     * @return the image for science and nature questions as base64 string
     */
    public static String getScienceAndNatureImage() {
	return "";
    }
    
    /**
     * @return the image for sport and leisure questions as base64 string
     */
    public static String getSportAndLeisureImage() {
	return "";
    }
    
    /**
     * Initialize the Categories in the database
     * Standard categories are based on Trivial Pursuit:
     * 	Geography, Entertainment, History, Arts & Literature, Science & Nature and Sport & Leisure
     */
    public void initialize() {
    	categoryRepository.save(new Category(CategoryInitializer.GEOGRAPHY));
    	categoryRepository.save(new Category(CategoryInitializer.ENTERTAINMENT));
    	categoryRepository.save(new Category(CategoryInitializer.HISTORY));
    	categoryRepository.save(new Category(CategoryInitializer.ART_AND_LITERATURE));
    	categoryRepository.save(new Category(CategoryInitializer.SCIENCE_AND_NATURE));
    	categoryRepository.save(new Category(CategoryInitializer.SPORT_AND_LEISURE));
    }
}
